import React from "react";

import {
  Nav,
  Navbar,
  Form,
  FormControl,
  Button,
  Container,
  Col,
  Row,
} from "react-bootstrap";

const footer = () => {
  return (
    <Navbar
      bg="dark"
      variant="dark"
      style={{ height: "400px" }}
      className="sticky-bottom"
    >
      <Container>
        <Row className="mx-auto">
          <Col md={6} xs={12}>
            Facebook Twitter Instagram Reddit
          </Col>
        </Row>
      </Container>
    </Navbar>
  );
};

export default footer;
